import React from 'react';

function AboutMeItem(props) {
  return (
    <>
      <div className='aboutme__item'>
        <img src={props.imageSrc} alt='About Me' className='aboutme__image' />
        <div className='aboutme__info'>
          <h2 className='aboutme__title'>{props.title}</h2>
          <h3 className='aboutme__subtitle'>{props.subtitle}</h3>
          <p className='aboutme__goal'>{props.goal}</p>
        </div>
      </div>
    </>
  );
}

export default AboutMeItem;
